commits.sourceNew:
/**
 * Create a new result from a key+weight+payload triple.
 */
public LookupResult(CharSequence key, long value, BytesRef payload) {
  this.key = key;
  this.value = value;
  this.payload = payload;
}

/**
 * Create a new result from a key+weight+payload triple.
 */
public LookupResult(CharSequence key, long value, BytesRef payload) {
  this.key = key;
  this.highlightKey = null;
  this.value = value;
  this.payload = payload;
}

